  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Pishkun, Willow
  Creek, and Benton Lake National Wildlife Refuges outlines Refuge accomplishments
  from January through April of 1943. The report begins by summarizing the weather
  conditions and water conditions during this period. Wildlife- including migratory
  birds, upland game birds, and predators- is also covered. The Refuge development
  and maintenance section discusses physical developments. Resource management is
  outlined; topics include grazing and haying.\",\n\t\"license_title\": \"License
